import React, { useState, useEffect } from "react";
import axios from "axios"


function App() {
    const [services, setServices] = useState([])
    useEffect(() => {
        axios.get("/services")
            .then(res => setServices(res.data))
            .catch(err => console.log(err))

    }, [])

    return (
        <div>

        </div>
    )
}

export default App
